Badger::Badger(QObject *parent) :
    QObject(parent)
{
    auto timer = new QTimer(this);
    connect(timer, SIGNAL(timeout()), this, SLOT(update()));
    timer->start(10);
}

void Badger::update()
{
    auto messageJson = QByteArray::fromRawData(dummyMessage, static_cast<int>(strlen(dummyMessage)));
    auto messageDocument = QJsonDocument::fromJson(messageJson);
    auto messageObj = messageDocument.object();
    emit message(messageObj);
}
